    "title": "Command Line Interface for PowerShell ##",
    "body": "Command Line Interface for PowerShell: This tool securely password-protects HTML files from the command line using PowerShell (written with v5 but will very likely work on lower versions and Core). It utilises . NET encryption libraries. This implementation will also support a number of cypher changes (eg. key size and hash iterations) which the template currently does not. Usage: Add this script and the decryptTemplate. html template into the same directory. To encrypt a string of text:. \Encrypt-StaticHTML. ps1 -Text '--text to encrypt--' -Password '--encryption password--' To encrypt a file:. \Encrypt-StaticHTML. ps1 -File example. html -Password '--encryption password--' Parameters: Mandatory:Password = key passwordText = text to encrypt, orFile = file to encrypt Optional:Template = Custom template locationOutFile = Destination fileKeySize = AES key size (default 32 bytes)Iterations = Hash iterations (default 100) Dependencies: None on Windows. "
